INSERT INTO `news` (`id`, `title`, `content`, `date`, `sign`)
VALUES
	(8,'发个新闻资讯看看','<p>\r\n	选择项比较少，就是js验证的问题\r\n</p>\r\n<p>\r\n	<img src=\"/zdezServer/attached/image/20130827/20130827160757_336.jpg\" alt=\"\" />\r\n</p>','2013-08-27 16:08:16',NULL),
	(9,'看看图片加载的问题','<p>\r\n	这次是测试图片加载\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<img src=\"/zdezServer/attached/image/20130827/20130827161148_66.jpg\" alt=\"\" />\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<img src=\"/zdezServer/attached/image/20130827/20130827161156_190.jpg\" alt=\"\" />\r\n</p>','2013-08-27 16:12:02',NULL),
	(10,'测试点新闻','手机发图好像是不行\r\n					','2013-08-30 10:43:13',NULL),
	(11,'test the news from mobile browser','			nothing serious				','2013-08-30 10:46:53',NULL),
	(12,'习近平会见俄罗斯总统普京','<h1 style=\"font-size:22px;font-family:\'Microsoft YaHei\', SimSun, sans-serif, ����;text-align:center;\">\r\n	习近平会见俄罗斯总统普京\r\n</h1>\r\n<p>\r\n	<p style=\"font-family:����;font-size:14px;\">\r\n		<br />\r\n	</p>\r\n	<p style=\"text-align:center;font-family:����;font-size:14px;\">\r\n		<img src=\"/zdezServer/attached/image/20130906/20130906113809_210.jpg\" alt=\"\" />\r\n	</p>\r\n	<p style=\"text-align:left;font-family:����;font-size:14px;\">\r\n		&nbsp; &nbsp; &nbsp; &nbsp;本报圣彼得堡９月５日电&nbsp;&nbsp;（记者杜尚泽、谢亚宏）国家主席习近平５日在圣彼得堡会见俄罗斯总统普京。\r\n	</p>\r\n	<p style=\"font-family:����;font-size:14px;\">\r\n		　　习近平表示，今年３月我对俄罗斯进行了成功的国事访问。此后，双方积极落实我们达成的一系列重要共识，推动１６个领域近５０项合作取得实际成果和积极进展。两国元首都高度重视两国合作，希望双方加快推进能源、航空等领域战略性大项目合作，继续深化军事军技合作，共同应对新威胁、新挑战。相信中俄合作一定能在已有扎实基础上继续有效向前推进，推进中俄全面战略协作伙伴关系向更高水平发展。\r\n	</p>\r\n	<p style=\"font-family:����;font-size:14px;\">\r\n		　　普京表示，俄中关系快速发展，两国元首保持定期会晤，双方各层面交往密切，各领域合作不断取得积极进展。我对此感到满意。我们今天将要签署一系列协议。这对两国今后长期稳定合作具有重要意义。俄方希望进一步提升两国经贸、能源、工业、高技术、军事军技等领域合作水平，搞好大项目合作，服务两国发展振兴，维护全球安全和稳定，不断巩固俄中全面战略协作伙伴关系的基础。\r\n	</p>\r\n	<p style=\"font-family:����;font-size:14px;\">\r\n		　　习近平还就俄罗斯远东地区遭受百年不遇的洪灾向普京表示慰问。习近平表示，黑龙江流域中方一侧灾情也十分严重。中俄政府和毗邻地区密切协作，携手抗洪救灾，生动体现了两国边境地区人民一家亲的深厚情谊。希望双方继续通力协作，共同夺取抗洪救灾斗争的最后胜利。\r\n	</p>\r\n	<p style=\"font-family:����;font-size:14px;\">\r\n		　　普京就中方灾情表达慰问，表示俄中在抗洪救灾过程中进行了密切友好配合，希望双方有关部门在汛情交换等方面继续加强合作。&nbsp;\r\n	</p>\r\n	<p style=\"font-family:����;font-size:14px;\">\r\n		　　习近平指出，当前，国际形势深刻复杂变化。中方全力支持俄罗斯举办二十国集团圣彼得堡峰会。中方愿同俄方密切配合，加强宏观经济政策协调，进一步推动国际经济和金融体系改革，反对贸易和投资保护主义，维护新兴市场国家发展利益。\r\n	</p>\r\n	<p style=\"font-family:����;font-size:14px;\">\r\n		　　普京感谢中方对二十国集团圣彼得堡峰会的支持，表示愿同中方加强协作，推动峰会在事关世界经济增长、推动国际金融体系改革、维护新兴市场国家权益等重大问题上取得成果。金砖国家要加强协调和配合。\r\n	</p>\r\n	<p style=\"font-family:����;font-size:14px;\">\r\n		　　会谈后，两国元首共同见证了能源、航空、地方合作等领域合作文件的签署。有关文件包括：中国石油天然气集团公司同俄罗斯天然气股份公司关于中俄东线天然气合作的框架协议、中国石油天然气集团公司同俄罗斯诺瓦泰克公司液化天然气股权合作协议、上海市政府和圣彼得堡市政府合作协议等。\r\n	</p>\r\n	<p style=\"font-family:����;font-size:14px;\">\r\n		　　王沪宁、汪洋、栗战书、杨洁篪等参加会见。\r\n	</p>\r\n</p>','2013-09-06 11:39:12',NULL);
