VALUES
	(312,'版本不会大改变后的测试第一条 -- 博客科技-办公室','<p style=\"color:#333333;font-family:Tahoma, \'Microsoft YaHei\', Verdana, Arial, Helvetica, sans-serif;font-size:15px;background-color:#FFFFFF;\">\r\n	来自爱尔兰的<a href=\"http://www.ipc.me/turbospoke.html\" class=\"selflink\">&nbsp;Turbospoke Bicycle Exhaust System</a>&nbsp;以其独特的<a href=\"http://www.ipc.me/tag/%E8%AE%BE%E8%AE%A1\" target=\"_blank\">设计</a>风靡欧美，无需电力、极为狂野的六种摩托车排气管发出的声音，五分钟即可完成安装，把你的自行车变成有趣的玩具……\r\n</p>\r\n<p style=\"text-align:center;color:#333333;font-family:Tahoma, \'Microsoft YaHei\', Verdana, Arial, Helvetica, sans-serif;font-size:15px;background-color:#FFFFFF;\">\r\n	<img class=\"aligncenter\" title=\"自行车涡轮排气管\" alt=\"自行车涡轮排气管\" src=\"http://ipc.chotee.com/uploads/post/11848/520c7cf384e87.jpg\" width=\"450\" height=\"250\" />\r\n</p>\r\n<p style=\"color:#333333;font-family:Tahoma, \'Microsoft YaHei\', Verdana, Arial, Helvetica, sans-serif;font-size:15px;background-color:#FFFFFF;\">\r\n	Turbospoke 不仅外观和真正的摩托车排气管很像，最出色的还是当你开始骑车的时候，排气管发出的声音和真正的摩托车非常像，好玩的是，当你骑得快的时候，它发出的声音就好像加了油门一样，会一直变化。踩得飞快的时候，完全能和真正的摩托车声音一样棒！Turbospoke 能够适合95%的自行车，从16寸的小轮到22寸的全尺寸自行车，都可轻易安装使用。\r\n</p>\r\n<p style=\"text-align:center;color:#333333;font-family:Tahoma, \'Microsoft YaHei\', Verdana, Arial, Helvetica, sans-serif;font-size:15px;background-color:#FFFFFF;\">\r\n	<img class=\"aligncenter\" title=\"自行车涡轮排气管\" alt=\"自行车涡轮排气管\" src=\"http://ipc.chotee.com/uploads/post/11848/520c7cf5c51c2.jpg\" width=\"500\" height=\"334\" />\r\n</p>\r\n<p style=\"text-align:center;color:#333333;font-family:Tahoma, \'Microsoft YaHei\', Verdana, Arial, Helvetica, sans-serif;font-size:15px;background-color:#FFFFFF;\">\r\n	<img class=\"aligncenter\" title=\"自行车涡轮排气管\" alt=\"自行车涡轮排气管\" src=\"http://ipc.chotee.com/uploads/post/11848/520c7cf78a444.jpg\" width=\"500\" height=\"334\" />\r\n</p>\r\n<p style=\"text-align:center;color:#333333;font-family:Tahoma, \'Microsoft YaHei\', Verdana, Arial, Helvetica, sans-serif;font-size:15px;background-color:#FFFFFF;\">\r\n	<img cl