	(401,'Test horizontal scroll use copy from word -- 博客科技-办公室','<p class=\"a\">\r\n	<a name=\"_Toc229846378\"></a><span>2.1 </span><span style=\"font-family:宋体;\">功能性需求</span><span></span>\r\n</p>\r\n<p class=\"3\">\r\n	<a name=\"_Toc229846379\"></a><span>2.1.1 </span><span style=\"font-family:宋体;\">信息管理系统：</span><span></span>\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:24.0pt;\">\r\n	<span style=\"font-family:宋体;\">&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;<img src=\"/zdezServer/attached/image/20130904/20130904160736_559.png\" alt=\"\" /></span>\r\n</p>\r\n<p class=\"MsoCaption\" style=\"text-indent:20.0pt;\">\r\n	<a name=\"_Toc355893113\"></a><span style=\"font-family:宋体;\">图表</span> <span></span><span></span><span><span><span>&nbsp;</span>STYLEREF 1 \\s <span></span></span></span><span>2</span><span></span><span></span><span>‑</span><span></span><span></span><span><span> SEQ </span></span><span><span style=\"font-family:宋体;\">图表</span><span> \\* ARABIC \\s 1 <span></span></span></span><span>1</span><span></span><span></span><span> </span><span style=\"font-family:宋体;\">信息管理系统用例</span> <span></span>\r\n</p>\r\n<p class=\"MsoCaption\" style=\"text-indent:20.0pt;\">\r\n	<a name=\"_Toc355893207\"></a><span style=\"font-family:宋体;\">表格</span> <span></span><span></span><span><span><span>&nbsp;</span>STYLEREF 1 \\s <span></span></span></span><span>2</span><span></span><span></span><span>‑</span><span></span><span></span><span><span> SEQ </span></span><span><span style=\"font-family:宋体;\">表格</span><span> \\* ARABIC \\s 1 <span></span></span></span><span>1</span><span></span><span></span><span> </span><span style=\"font-family:宋体;\">信息管理系统用例说明</span><span></span>\r\n</p>\r\n<table class=\"MsoTableGrid\" border=\"1\" cellspacing=\"0\" cellpadding=\"0\" style=\"border-collapse:collapse;border:none;\">\r\n	<tbody>\r\n		<tr>\r\n			<td valign=\"top\" style=\"border:solid windowtext 1.0pt;\">\r\n				<p class=\"MsoNormal\" style=\"text-indent:0cm;\">\r\n					<b><span style=\"font-family:宋体;\">用例名称<span></span></span></b>\r\n				</p>\r\n			</td>\r\n			<td valign=\"top\" style=\"border:solid windowtext 1.0pt;background:#BFBFBF;\">\r\n				<p class=\"MsoNormal\" style=\"text-indent:0cm;\">\r\n					<span style=\"font-family:宋体;\">信息管理员发送信息<span></span></span>\r\n				</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td valign=\"top\" style=\"border:solid windowtext 1.0pt;\">\r\n				<p class=\"MsoNormal\" style=\"text-indent:0cm;\">\r\n					<b><span style=\"font-family:宋体;\">参与者<span></span></span></b>\r\n				</p>\r\n			</td>\r\n			<td valign=\"top\" style=\"border:solid windowtext 1.0pt;\">\r\n				<p class=\"MsoNormal\" style=\"text-indent:0cm;\">\r\n					<span style=\"font-family:宋体;\">信息管理员（一般为教师）<span></span></span>\r\n				</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td valign=\"top\" style=\"border:solid windowtext 1.0pt;\">\r\n				<p class=\"MsoNormal\" style=\"text-indent:0cm;\">\r\n					<b><span style=\"font-family:宋体;\">涉众及关注点<span></span></span></b>\r\n				</p>\r\n			</td>\r\n			<td valign=\"top\" style=\"border:solid windowtext 1.0pt;\">\r\n				<p class=\"MsoNormal\" style=\"text-indent:0cm;\">\r\n					<span style=\"font-family:宋体;\">信息管理员：希望能够准确快速地进行输入信息内容，输入错误有良好提示，信息发送失败有明确提示。<span></span></span>\r\n				</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td valign=\"top\" style=\"border:solid windowtext 1.0pt;\">\r\n				<p class=\"MsoNormal\" style=\"text-indent:0cm;\">\r\n					<b><span style=\"font-family:宋体;\">前置条件<span></span></span></b>\r\n				</p>\r\n			</td>\r\n			<td valign=\"top\" style=\"border:solid windowtext 1.0pt;\">\r\n				<p class=\"MsoNormal\" style=\"text-indent:0cm;\">\r\n					<span style=\"font-family:宋体;\">教师必须经过资格确认和培训认证<span></span></span>\r\n				</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td valign=\"top\" style=\"border:solid windowtext 1.0pt;\">\r\n				<p class=\"MsoNormal\" style=\"text-indent:0cm;\">\r\n					<b><span style=\"font-family:宋体;\">基本流程<span></span></span></b>\r\n				</p>\r\n			</td>\r\n			<td valign=\"top\" style=\"border:solid windowtext 1.0pt;\">\r\n				<p class=\"MsoNormal\" style=\"text-indent:0cm;\">\r\n					<span style=\"font-family:宋体;\">1. </span><span style=\"font-family:宋体;\">教师打开浏览器登录信息管理系统面板<span></span></span>\r\n				</p>\r\n				<p class=\"MsoNormal\" style=\"text-indent:0cm;\">\r\n					<span style=\"font-family:宋体;\">2. </span><span style=\"font-family:宋体;\">打开信息管理面，新建信息<span></span></span>\r\n				</p>\r\n				<p class=\"MsoNormal\" style=\"text-indent:0cm;\">\r\n					<span style=\"font-family:宋体;\">3. </span><span style=\"font-family:宋体;\">输入消息的标题，内容，选择受众用户条件<span></span></span>\r\n				</p>\r\n				<p class=\"MsoNormal\" style=\"text-indent:0cm;\">\r\n					<span style=\"font-family:宋体;\">4. </span><span style=\"font-family:宋体;\">点击“确认发送<span></span></span>\r\n				</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td valign=\"top\" style=\"border:solid windowtext 1.0pt;\">\r\n				<p class=\"MsoNormal\" style=\"text-indent:0cm;\">\r\n					<b><span style=\"font-family:宋体;\">异常事件流<span></span></span></b>\r\n				</p>\r\n			</td>\r\n			<td valign=\"top\" style=\"border:solid windowtext 1.0pt;\">\r\n				<p class=\"MsoListParagraph\" style=\"margin-left:18.0pt;text-indent:-18.0pt;\">\r\n					<span style=\"font-family:宋体;\">1.<span style=\"font-size:7pt;font-family:\'Times New Roman\';\">&nbsp; </span></span><span style=\"font-family:宋体;\">登陆错误，提示错误信息，重新登陆<span></span></span>\r\n				</p>\r\n				<p class=\"MsoListParagraph\" style=\"margin-left:18.0pt;text-indent:-18.0pt;\">\r\n					<span style=\"font-family:宋体;\">2.<span style=\"font-size:7pt;font-family:\'Times New Roman\';\">&nbsp; </span></span><span style=\"font-family:宋体;\">新建信息超出字数，提示信息<span></span></span>\r\n				</p>\r\n				<p class=\"MsoListParagraph\" style=\"margin-left:18.0pt;text-indent:-18.0pt;\">\r\n					<span style=\"font-family:宋体;\">3.<span style=\"font-size:7pt;font-family:\'Times New Roman\';\">&nbsp; </span></span><span style=\"font-family:宋体;\">发送失败，重新发送<span></span></span>\r\n				</p>\r\n			</td>\r