	(448,'世卫发布10组最新健康数据（热点聚焦） -- 博客科技-办公室','<p style=\"font-family:宋体;font-size:14px;\">\r\n	21世纪已经过去了13年，如今全球的卫生总体状况如何？日前，世界卫生组织发布了10组关于全球卫生状况的最新数据。\r\n</p>\r\n<p style=\"font-family:宋体;font-size:14px;\">\r\n	　　每天3500人死于车祸\r\n</p>\r\n<p style=\"font-family:宋体;font-size:14px;\">\r\n	　　全球卫生状况的10组数据分别为：1.1990年以来，全球人均期望寿命增加了6岁，在2011年出生的婴儿平均可活到70岁；2.每年约有700万名5岁以下儿童死亡；3.早产是全世界新生儿的主要杀手，每年有1500万婴儿（约为婴儿的1/10）出生过早（在怀孕37周之前出生并存活），早产并发症每年造成100多万例死亡；4.心血管疾病是全世界主要死因，全球每10名死者中就有3名由心血管疾病造成——可造成心脏病发作和中风；5.2011年艾滋病毒/艾滋病死亡总数中，约有70%发生在撒哈拉以南非洲;6.每天几乎有800名妇女死于妊娠和分娩并发症；7.抑郁症等精神卫生障碍是全球范围内造成残疾的20个主要原因之一；8.听力丧失、视力问题和精神障碍是最常见的致残原因；9.每10名成人中约有1人患糖尿病；10.每天有近3500人死于车祸。\r\n</p>\r\n<p style=\"font-family:宋体;font-size:14px;\">\r\n	　　中国糖尿病患者超1亿\r\n</p>\r\n<p style=\"font-family:宋体;font-size:14px;\">\r\n	　　北京大学医学部公卫学院教授钮文异告诉记者，这10组数据反映了全球的健康状况，和我国具体情况相比，还略有不同：\r\n</p>\r\n<p style=\"font-family:宋体;font-size:14px;\">\r\n	　　首先，我国平均寿命现在已达到73.5岁，其中，东部沿海地区的人均寿命更高，我们现在的目标是在“十二五”期间，国内平均寿命能再增长1岁。从解放初期人均寿命30多岁到现在的73.5岁，已经超出了世界平均水平，足可以看出这些年我国在卫生事业上取得的成就。平均寿命是衡量一个国家健康水平的重要指标，影响这个指标高低的关键是新生儿的死亡。和全世界一样，我国也是通过卫生体系的完善和有效的治疗，关注母子的身体健康。现在我们提出“关注生命1000天”，就是关注从出生到3岁左右的婴幼儿的健康，特别是贫困地区。对于新生儿的早产和孕妇分娩的危险，我国已经开始了对偏远山区计生和分娩人员进行培训，以降低母婴死亡率；另外，提高住院分娩的比例，落实产前5次以上的检查，也是降低孕妇和新生儿死亡率的有效途径之一。\r\n</p>\r\n<p style=\"font-family:宋体;font-size:14px;\">\r\n	　　其次，糖尿病在我国近10年呈井喷态势，目前，中国糖尿病患者已经超过1亿。它和心脑血管疾病都有着相同的病理背景——“代谢综合征”，它们的健康风险因素都是饮食引起的，其中心脑血管疾病已成为中国人的头号杀手。&nbsp;\r\n</p>\r\n<p style=\"font-family:宋体;font-size:14px;\">\r\n	　　再次，虽然在我国，艾滋病正处在快速增长期，但更严重的传染病是结核病、乙肝等。其中，结核病发病的绝对人数位居全球第二，仅排在印度之后。对于传染病的防控，我们需要进一步加强全社会健康教育。\r\n</p>\r\n<p style=\"font-family:宋体;font-size:14px;\">\r\n	　　最后，需要注意的是抑郁症，它在我国的发展速度超出想象。专家预测，预计到2020年，我国的精神障碍方面的患者总数将会上升到世界第一。&nbsp;\r\n</p>\r\n<p style=\"font-family:宋体;font-size:14px;\">\r\n	　　自我保健意识最重要\r\n</p>\r\n<p style=\"font-family:宋体;font-size:14px;\">\r\n	　　钮文异认为，随着现代化的进程，生活条件越来越好，健康问题却越来越严重。政府和社会都有责任来提高全民的健康意识，科学地管理常见疾病的风险因素，有效地干预和治疗。\r\n</p>\r\n<p style=\"font-family:宋体;font-size:14px;\">\r\n	　　钮文异呼吁，每个人都是自我健康的第一责任人，提高我们每个人的健康素养，胜过灵丹妙药。▲\r\n</p>','2013-09-06 10:04:19','bokeltd'),
