INSERT INTO `zdezMsg` (`id`, `title`, `content`, `date`, `adminId`)
VALUES
	(1,'找得着信息全选测试第一条','<p>\r\n	这是测试内容， 贴张图进来看看。\r\n</p>\r\n<p>\r\n	<img src=\"/zdezServer/attached/image/20130827/20130827161529_257.jpg\" alt=\"\" />\r\n</p>\r\n<p>\r\n	复制点网络上的字\r\n</p>\r\n<p>\r\n	<h2 id=\"news_title\" style=\"vertical-align:baseline;font-size:20px;color:#003366;font-family:微软雅黑, Tahoma, Verdana, 宋体;text-align:center;background-color:#FFFFFF;\">\r\n		世界销量最高的手机 TOP 16\r\n	</h2>\r\n	<div class=\"introduction\" style=\"margin:10px auto 15px;padding:10px 24px 13px 20px;vertical-align:baseline;background-color:#FBFBFB;font-size:16px;color:#434343;font-family:微软雅黑, Tahoma, Verdana, 宋体;\">\r\n		<p style=\"vertical-align:baseline;\">\r\n			至今为止，仍没有任何一手机厂商能打破诺基亚1110，2005年上市，销售2亿5千万台。也是唯一一部销量超过2亿的手机。\r\n		</p>\r\n		<p style=\"vertical-align:baseline;\">\r\n			<span style=\"font-weight:700;\">五千万以上销量的手机：</span>\r\n		</p>\r\n	</div>\r\n	<div class=\"content\" style=\"margin:10px;padding:0px;vertical-align:baseline;font-size:16px;font-family:微软雅黑, Tahoma, Verdana, 宋体;background-color:#FFFFFF;\">\r\n		<p style=\"vertical-align:baseline;\">\r\n			第16名：<a target=\"_blank\">诺基亚</a>6230，2004年上市，销售5千万台。\r\n		</p>\r\n		<p style=\"vertical-align:baseline;\">\r\n			第15名：诺基亚3100，2003年上市，销量超过5千万台。\r\n		</p>\r\n		<p style=\"vertical-align:baseline;\">\r\n			第14名：<a target=\"_blank\">摩托罗拉</a>StarTAC，1996年上市，销量6千万台\r\n		</p>\r\n		<p style=\"vertical-align:baseline;\">\r\n			第13名：摩托罗拉C200，2003年上市，销售六千万台\r\n		</p>\r\n		<p style=\"vertical-align:baseline;\">\r\n			第12名：<a target=\"_blank\">iPhone</a>&nbsp;4S，2011年上市，销量超6千万台\r\n		</p>\r\n		<p style=\"vertical-align:baseline;\">\r\n			第11名：Nokia 5130，2007年上市，销售6千5百万台\r\n		</p>\r\n		<p style=\"vertical-align:baseline;\">\r\n			第10名：Nokia 6010，2004年上市，销售7千5百万台。\r\n		</p>\r\n		<p style=\"vertical-align:baseline;\">\r\n			<span style=\"font-weight:700;\">销量在1亿部以上的手机：</span>\r\n		</p>\r\n		<p style=\"vertical-align:baseline;\">\r\n			第9名：Nokia 1208，2007年上市，销售1亿台。\r\n		</p>\r\n		<p style=\"vertical-align:baseline;\">\r\n			第8名：Nokia 1600，2006年上市，销售1亿3千万台。\r\n		</p>\r\n		<p style=\"vertical-align:baseline;\">\r\n			第7名：摩托罗拉RAZR V3，2004年上市，销售超过1亿3千万台。\r\n		</p>\r\n		<p style=\"vertical-align:baseline;\">\r\n			第6名：Nokia 2600，2004年上市，销售1亿3千5百万台。\r\n		</p>\r\n		<p style=\"vertical-align:baseline;\">\r\n			第5名：Nokia 3310，2000年上市，销售1亿3千6百万台。\r\n		</p>\r\n		<p style=\"vertical-align:baseline;\">\r\n			第4名：Nokia 5230，2010年上市，销售1亿5千万台。\r\n		</p>\r\n		<p style=\"vertical-align:baseline;\">\r\n			第3名、Nokia 1200：2007年上市，销售1亿5千万台。\r\n		</p>\r\n		<p style=\"vertical-align:baseline;\">\r\n			第2名：Nokia 3210，1999年上市，销售1亿6千万台。\r\n		</p>\r\n		<p style=\"vertical-align:baseline;\">\r\n			<span style=\"font-weight:700;\">销量突破两亿的手机：</span>\r\n		</p>\r\n		<p style=\"vertical-align:baseline;\">\r\n			第1名：诺基亚1110，2005年上市，销售2亿5千万台。也是唯一一部销量超过2亿的手机\r\n		</p>\r\n		<p style=\"vertical-align:baseline;\">\r\n			这次我们来看一下排名1-10名的手机！诺基亚威武啊！\r\n		</p>\r\n		<p style=\"vertical-align:baseline;\">\r\n			<span style=\"font-weight:700;\">NO.10、NO.9和NO.8</span>\r\n		</p>\r\n		<p style=\"vertical-align:baseline;\">\r\n			诺基亚6010，一共售出7500万台，在当时看来彩屏手机就意味着高端！\r\n		</p>\r\n		<p style=\"vertical-align:baseline;\">\r\n			诺基亚1208，现在在路上你依旧能看得到的身影，一共售出1亿的销量能说明一切。\r\n		</p>\r\n		<p style=\"vertical-align:baseline;\">\r\n			诺基亚1600，或许你忘了它长什么样，但是你肯定不会忘记上面经典的足球游戏，发售之后大卖1亿3000万部。\r\n		</p>\r\n		<p style=\"vertical-align:baseline;\">\r\n			NO.7 摩托罗拉的Razr V3，如果说什么时候的摩托罗拉让人印象最为深刻，相信V3时代的摩托罗拉当之无愧，1亿3000万，需要质疑吗？\r\n		</p>\r\n		<p style=\"vertical-align:baseline;\">\r\n			<span style=\"font-weight:700;\">NO.6 、NO.5和NO.4</span>\r\n		</p>\r\n		<p style=\"vertical-align:baseline;\">\r\n			诺基亚2600，漂亮的<a target=\"_blank\">键盘</a>设计为它带来了1亿3500万的销量。\r\n		</p>\r\n		<p style=\"vertical-align:baseline;\">\r\n			诺基亚3310，“经典”两个字已经不能概括这款设备 ，不过幸好1亿3600万的销量能够说明很多。\r\n		</p>\r\n		<p style=\"vertical-align:baseline;\">\r\n			诺基亚5230，绝对的“街机”没有之一，相信现在还有不少的诺基亚5230在大家手上服役，从2010年推出之后，一共售出了1亿5000万\r\n		</p>\r\n		<p style=\"vertical-align:baseline;\">\r\n			<span style=\"font-weight:700;\">NO.3 诺基亚1200</span>\r\n		</p>\r\n		<p style=\"vertical-align:baseline;\">\r\n			诺基亚1208的前身， 2007年推出，一共售出1亿5000万台，软软的塑料键盘大家不会忘了吧？\r\n		</p>\r\n		<p style=\"vertical-align:baseline;\">\r\n			<span style=\"font-weight:700;\">NO.2 诺基亚3210</span>\r\n		</p>\r\n		<p style=\"vertical-align:baseline;\">\r\n			对于现在的用户来说，或许它已经有些久远，1999年上市，一共卖出了1亿6000万台。\r\n		</p>\r\n		<p style=\"vertical-align:baseline;\">\r\n			<img alt=\"http://static.cnbetacdn.com/newsimg/2013/0826/01377504326.jpg\" src=\"http://static.cnbetacdn.com/newsimg/2013/0826/01377504326.jpg\" />\r\n		</p>\r\n		<p style=\"vertical-align:baseline;\">\r\n			<span style=\"font-weight:700;\">NO.1 诺基亚1110</span>\r\n		</p>\r\n		<p style=\"vertical-align:baseline;\">\r\n			2亿5000万，不用太多的解释，不过若是有统计手机游戏的话，想来“贪吃蛇”应该是最风靡的手游！\r\n		</p>\r\n	</div>\r\n</p>','2013-08-27 16:16:54','luo'),
	(2,'找得着信息测试图片加载问题','<p>\r\n	本地图片第一次无法加载，第二次点击进入才可加载。 是不是有这个问题？\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	这是个本地图片\r\n</p>\r\n<p>\r\n	<img src=\"/zdezServer/attached/image/20130827/20130827162046_189.jpg\" alt=\"\" />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	网络图片好像没这问题， 下边是个网络图片\r\n</p>\r\n<p>\r\n	<p style=\"vertical-align:baseline;font-family:微软雅黑, Tahoma, Verdana, 宋体;font-size:16px;background-color:#FFFFFF;\">\r\n		<a target=\"_blank\" href=\"http://static.cnbetacdn.com/newsimg/2013/0827/11377589974.jpg\"><img alt=\"Z10\" src=\"http://static.cnbetacdn.com/newsimg/2013/0827/11377589974.jpg_w600.jpg\" /></a>\r\n	</p>\r\n</p>','2013-08-27 16:26:48','luo'),
	(3,'中国老年人营养很不好','<h1 style=\"font-size:22px;font-family:宋体;text-align:center;\">\r\n	<br />\r\n	<p style=\"font-family:宋体;font-size:14px;\">\r\n		重点提示：老年人有以下情况，要考虑营养不良：65岁以上的老年人，如果三个月内体重下降5%或半年内体重下降10%；最近连续一个月以上食物摄入量比以往少三分之一；小腿围在逐渐减小，而且已小于31厘米；有明显痴呆或抑郁倾向的。\r\n	</p>\r\n	<p style=\"font-family:宋体;font-size:14px;\">\r\n		<br />\r\n	</p>\r\n	<p style=\"font-family:宋体;font-size:14px;\">\r\n		　　2012年，复旦大学附属华东医院临床营养中心主任孙建琴带领的研究团队调查了北京、上海、广州、成都、重庆5大城市共6000多名医院住院和养老院的老年人，发现平均营养不良率有16%，有营养风险的占37%，如维生素D、钙等缺乏会威胁骨骼健康，B族维生素摄入不足与老年人抑郁之间存在相关性。\r\n	</p>\r\n	<p style=\"font-family:宋体;font-size:14px;\">\r\n		　　“老年人在嗅觉和味觉方面会发生一些变化，他们会选择自己喜欢的食品，如蔬菜、糖类等，而不太喜欢富含蛋白质的肉食等，因此会造成营养不均衡，抵抗力容易下降。”欧盟老年医学学会主席、日内瓦医科大学医学荣誉教授Michel说。\r\n	</p>\r\n	<p style=\"font-family:宋体;font-size:14px;\">\r\n		　　要像管理疾病一样管理老年人营养状况，分阶段分类型进行。比如老年人出院后更要注意营养补充，研究表明，与住院前相比，出院后营养不良的比例更高。而国内的出院病人基本上还处于家庭“散养”阶段，根据身体情况服用口服营养补充剂的老人更少之又少。\r\n	</p>\r\n	<p style=\"font-family:宋体;font-size:14px;\">\r\n		　　中国营养学会老年营养分会资料显示，老年人营养不良不易被发现，一些自测量化指标可参考：65岁以上的老年人，如果三个月内体重下降5%或半年内体重下降10%；最近连续一个月以上食物摄入量比以往少三分之一；小腿围在逐渐减小，而且已小于31厘米；有明显痴呆或抑郁倾向的。Michel教授介绍说，“调查发现，体重持续下降的老年人比体重稳定或微增的老年人来讲，生存率明显下降。”\r\n	</p>\r\n	<p style=\"font-family:宋体;font-size:14px;\">\r\n		　　中国营养学会老年营养分会根据老年人营养和膳食特点，提出老年人平衡膳食“十个拳头”原则：建议总量不超过一个拳头大小的肉类(鱼、禽、蛋、肉)；相当于两个拳头的谷类(粗粮、杂豆和薯类)；要保证两个拳头的奶类和豆制品(牛奶及其制品、豆制品)；不少于五个拳头的果蔬。另外，老年人增加餐次也较重要，可以少量多餐，加餐时可吃点奶类制品等。\r\n	</p>\r\n</h1>','2013-09-07 13:40:58','luo');
